(2, 'English Level Check Form', '<div style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">Moving on, please find attached content for the online English level check.&nbsp;</div><div style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\"><br></div><div style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\">The check/test needs to be:</div><div style=\"color: rgb(34, 34, 34); font-family: Arial, Helvetica, sans-serif; font-size: small;\"><ul><li style=\"margin-left: 15px;\">&nbsp;in multiple-choice format: A,B,C</li><li style=\"margin-left: 15px;\">be accessed from the \'courses\' menu and also from an icon on the landing page</li></ul><div><table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"160\" style=\"width: 120pt;\"><colgroup><col width=\"160\" style=\"width: 120pt;\"></colgroup><tbody><tr height=\"20\" style=\"height: 15pt;\"><td height=\"20\" width=\"160\" style=\"font-family: Calibri, sans-serif; margin: 0px; height: 15pt; width: 120pt; font-weight: 700; padding-top: 1px; padding-right: 1px; padding-left: 1px; color: black; font-size: 11pt; vertical-align: bottom; border: none; white-space: nowrap;\">Courses</td></tr><tr height=\"20\" style=\"height: 15pt;\"><td height=\"20\" style=\"font-family: Calibri, sans-serif; margin: 0px; height: 15pt; padding-top: 1px; padding-right: 1px; padding-left: 1px; color: black; font-size: 11pt; vertical-align: bottom; border: none; white-space: nowrap;\">General English</td></tr><tr height=\"20\" style=\"height: 15pt;\"><td height=\"20\" style=\"font-family: Calibri, sans-serif; margin: 0px; height: 15pt; padding-top: 1px; padding-right: 1px; padding-left: 1px; color: black; font-size: 11pt; vertical-align: bottom; border: none; white-space: nowrap;\">Professional English</td></tr><tr height=\"20\" style=\"height: 15pt;\"><td height=\"20\" style=\"font-family: Calibri, sans-serif; margin: 0px; height: 15pt; padding-top: 1px; padding-right: 1px; padding-left: 1px; color: black; font-size: 11pt; vertical-align: bottom; border: none; white-space: nowrap;\">IELTS Preparation</td></tr><tr height=\"20\" style=\"height: 15pt;\"><td height=\"20\" style=\"font-family: Calibri, sans-serif; margin: 0px; height: 15pt; padding-top: 1px; padding-right: 1px; padding-left: 1px; color: black; font-size: 11pt; vertical-align: bottom; border: none; white-space: nowrap;\">Academic English</td></tr><tr height=\"20\" style=\"height: 15pt;\"><td height=\"20\" style=\"font-family: Calibri, sans-serif; margin: 0px; height: 15pt; padding-top: 1px; padding-right: 1px; padding-left: 1px; color: black; font-size: 11pt; vertical-align: bottom; border: none; white-space: nowrap;\">One-to-one English</td></tr><tr height=\"20\" style=\"height: 15pt;\"><td height=\"20\" style=\"font-family: Calibri, sans-serif; margin: 0px; height: 15pt; padding-top: 1px; padding-right: 1px; padding-left: 1px; color: black; font-size: 11pt; vertical-align: bottom; border: none; white-space: nowrap;\">University Pathways</td></tr><tr height=\"20\" style=\"height: 15pt;\"><td height=\"20\" style=\"font-family: Calibri, sans-serif; margin: 0px; height: 15pt; background: rgb(255, 192, 0); padding-top: 1px; padding-right: 1px; padding-left: 1px; color: black; font-size: 11pt; vertical-align: bottom; border: none; white-space: nowrap;\">English Level Check</td></tr></tbody></table></div><div><br></div><div>Also, a web form needs to be built into this journey. I suggest this precedes the actual level check.</div><div><br></div><div>Please let me know if you have any questions.</div></div>', '2021-04-10', '2021-04-03', 1, NULL, 'medium', 'incomplete', 1, 0, NULL, 2, NULL, NULL, '2021-04-01 20:06:03', '2022-03-02 02:57:49', NULL, 0, 1, 0, 0, '86da2ed28c11fdd1bc43be27ee85b1af', 1, 1, 0, 0, NULL, 'day', NULL, NULL),
