(223, 'Website Layout Design', '<p>We need to redesign the boost education website for the rebranding. We have to build Frontend and Backend both.&nbsp;</p><p>Technologies we will use:&nbsp;</p><p>--------------------------</p><p>Frontend: Js, Nuxt js, TailwindCss</p><p>Backend: PHP - Laravel, Vue.js</p><p>Database: Mysql</p><p>What we need in the design Layout:&nbsp;</p><p>-----------------------------------</p><p>- User-friendly / Highly SEO friendly Layout ( Discuss with Digital Marketer )</p><p>- Design In general all pages such as (About/Services/Blog/Contact etc)</p><p>- Main Focus on Courses</p><p>- Course Single page&nbsp;</p><p>- Course Search page</p><p>- Excellent Typography (Font/Color)</p><p>- Use less images ( don\'t use images for courses )</p><p>- Beautify Application Form / Enquiry Form etc</p><p>- Focus on Mobile Version / Tablet layout design. 90% of visitors use mobile to visit</p><p>- Research on it. Take time and make a wonderful design for Boost Education</p><p>You can also discuss more with GM Shafiq</p><p>- For Backend We will discuss later</p>', '2022-07-20', '2022-06-28', 15, 5, 'medium', 'incomplete', 1, 0, NULL, 2, NULL, NULL, '2022-06-28 18:33:04', '2022-06-28 18:33:04', NULL, 0, 1, 0, 0, 'UJlwlSlzC6lX2DsbLYCcCNCRqwTsZP3U', 2, 2, 0, 0, NULL, 'day', NULL, NULL),
